            <img
              alt="ingredient img"
              data-testid={ `${inderes}-card-img` }
              src={ `https://www.themealdb.com/images/ingredients/${x.strIngredient}-Small.png` }
            />
            <p data-testid={ `${index}-card-name` }>{ x.strIngredient }</p>
          </button>
        ))
      }
    </div>
  );
}
export default IngredientsFoods;
